import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./SearchAndSort.css";

const jobTypes = ["Full-Time", "Part-Time", "Remote"];
const skillsOptions = ["HTML", "CSS", "SQLite", "Python", "JavaScript", "Node Js", "React Js", "Express Js"];

const SearchAndSort = ({ isLoggedIn, onFilter }) => {
  const [searchTerm, setSearchTerm] = useState("");
  const [selectedSkills, setSelectedSkills] = useState([]);
  const [location, setLocation] = useState("");
  const [jobType, setJobType] = useState("");
  const [minSalary, setMinSalary] = useState("");
  const [maxSalary, setMaxSalary] = useState("");
  const [sortBy, setSortBy] = useState("");
  
  const navigate = useNavigate();

  const handleSearchChange = (e) => setSearchTerm(e.target.value);
  const handleSkillChange = (e) => {
    const skill = e.target.value;
    if (skill && !selectedSkills.includes(skill)) {
      setSelectedSkills([...selectedSkills, skill]);
    }
    e.target.value = "";
  };

  const removeSkill = (index) => {
    setSelectedSkills(selectedSkills.filter((_, i) => i !== index));
  };

  const clearFilters = () => {
    setSearchTerm("");
    setSelectedSkills([]);
    setLocation("");
    setJobType("");
    setMinSalary("");
    setMaxSalary("");
    setSortBy("");
  };

  const handleFilter = () => {
    onFilter({ searchTerm, selectedSkills, location, jobType, minSalary, maxSalary, sortBy });
  };

  return (
    <div className="search-filter-container">
      <input type="text" placeholder="Search jobs..." value={searchTerm} onChange={handleSearchChange} className="search-input" />

      <div className="filter-row">
        <select className="skills-dropdown" onChange={handleSkillChange}>
          <option value="">Select Skills</option>
          {skillsOptions.map((skill, index) => (
            <option key={index} value={skill}>{skill}</option>
          ))}
        </select>

        <select value={location} onChange={(e) => setLocation(e.target.value)} className="filter-dropdown">
          <option value="">Select Location</option>
          <option value="New York">New York</option>
          <option value="San Francisco">San Francisco</option>
        </select>

        <select value={jobType} onChange={(e) => setJobType(e.target.value)} className="filter-dropdown">
          <option value="">Select Job Type</option>
          {jobTypes.map((type, index) => (
            <option key={index} value={type}>{type}</option>
          ))}
        </select>

        <input type="number" placeholder="Min Salary" value={minSalary} onChange={(e) => setMinSalary(e.target.value)} className="filter-input" />
        <input type="number" placeholder="Max Salary" value={maxSalary} onChange={(e) => setMaxSalary(e.target.value)} className="filter-input" />

        <select value={sortBy} onChange={(e) => setSortBy(e.target.value)} className="filter-dropdown">
          <option value="">Sort By</option>
          <option value="date">Date Posted</option>
          <option value="salary">Salary</option>
        </select>

        <button className="apply-filter-btn" onClick={handleFilter}>Apply Filter</button>
        <button className="clear-filters" onClick={clearFilters}>Clear Filters</button>
      </div>
    </div>
  );
};

export default SearchAndSort;
